            manual_shortcuts: function (c, b, d) {
                this.b(d || "");
                this.b('<div class="markeddown"> <hr> <div class="shortcut"> <div class="keys"> <a>&larr;</a> <a>&darr; / J</a> <a>&uarr; / K</a> <a>&rarr;</a> </div> <h3>Navigate Cards</h3> <p> Pressing the arrow keys will select adjacent cards on a board. Pressing \u201cj\u201d will select the card below the current card. Pressing \u201ck\u201d will select the card above the current card. </p> </div> <div class="shortcut"> <div class="keys"> <a>B</a> </div> <h3>Open Header Boards Menu</h3> <p> Pressing \u201cb\u201d opens the boards menu in the header. You can search for boards and navigate boards with the up and down arrows. Pressing enter with a board selected will open it. </p> </div> <div class="shortcut"> <div class="keys"> <a>C</a> </div> <h3>Archive Card</h3> <p> Pressing \u201cc\u201d will archive a card. </p> </div> <div class="shortcut"> <div class="keys"> <a>D</a> </div> <h3>Due Date</h3> <p> Pressing \u201cd\u201d will open the due date picker for a card. </p> </div> <div class="shortcut"> <div class="keys"> <a>E</a> </div> <h3>Edit the Card Description</h3> <p> If viewing a card, pressing \u201ce\u201d will edit the description. If hovering over a card, pressing \u201ce\u201d will open the card and edit the description. </p> </div> <div class="shortcut"> <div class="keys"> <a>ESC</a> </div> <h3>Close Menu / Cancel Editing</h3> <p> Pressing \u201cesc\u201d will close an open dialog window or pop-over or cancel edits and comments you are composing. </p> </div> <div class="shortcut"> <div class="keys"> <a>ENTER</a> </div> <h3>Open Card</h3> <p> Pressing \u201center\u201d will open the currently selected card. Pressing \u201cshift + enter\u201d while submitting a card will open it immediately after creating it. </p> </div> <div class="shortcut"> <div class="keys"> <a>F</a> </div> <h3>Open Card Filter Menu</h3> <p> Use \u201cf\u201d to open the card filter menu. The search by title input is automatically focused. </p> </div> <div class="shortcut"> <div class="keys"> <a>L</a> </div> <h3>Label</h3> <p> Pressing \u201cl\u201d opens a pop-over of the available labels. Clicking a label will add or remove it from the card. </p> <p> Pressing one of the following number keys, will apply or remove that label. </p> <table> <thead> <tr> <th>Key</th> <th>Label Color</th> </tr> </thead> <tbody> <tr> <td>1</td> <td>Green</td> </tr> <tr> <td>2</td> <td>Yellow</td> </tr> <tr> <td>3</td> <td>Orange</td> </tr> <tr> <td>4</td> <td>Red</td> </tr> <tr> <td>5</td> <td>Purple</td> </tr> <tr> <td>6</td> <td>Blue</td> </tr> </tbody> </table> </div> <div class="shortcut"> <div class="keys"> <a>M</a> </div> <h3>Add / Remove Members</h3> <p> Pressing \u201cm\u201d opens the add / remove members menu. Clicking a member\u2019s avatar will assign or unassign that person. </p> </div> <div class="shortcut"> <div class="keys"> <a>N</a> </div> <h3>Insert New Card</h3> <p> Pressing \u201cn\u201d opens a pop-over that allows you to add a card after the currently selected card. </p> </div> <div class="shortcut"> <div class="keys"> <a>&lt;</a> <a>&gt;</a> </div> <h3>Move Card to Adjacent List</h3> <p> Pressing the left or right angle brackets (&lt; and &gt;) will move a card to the adjacent left or right list. </p> </div> <div class="shortcut"> <div class="keys"> <a>Q</a> </div> <h3>My Cards Filter</h3> <p> Pressing the \u201cq\u201d key toggles the \u201ccards assigned to me\u201d filter. </p> </div> <div class="shortcut"> <div class="keys"> <a>S</a> </div> <h3>Subscribe</h3> <p> Pressing \u201cs\u201d will subscribe you to, or unsubscribe you from, a card. Subscribing to a card will give you notifications for most actions to that card. </p> </div> <div class="shortcut"> <div class="keys"> <a>SPACE</a> </div> <h3>Assign Self</h3> <p> Pressing \u201cspace\u201d will assign (or unassign) yourself to a card. </p> </div> <div class="shortcut"> <div class="keys"> <a>T</a> </div> <h3>Edit Title</h3> <p> If viewing a card, pressing \u201ct\u201d will edit the title. If hovering over a card, pressing \u201ct\u201d will open the card and edit the title. </p> </div> <div class="shortcut"> <div class="keys"> <a>V</a> </div> <h3>Vote</h3> <p> Pressing \u201cv\u201d will add (or remove) your vote on a card. </p> </div> <div class="shortcut"> <div class="keys"> <a>X</a> </div> <h3>Clear All Filters</h3> <p> Use \u201cx\u201d to clear all active card filters. </p> </div> <div class="shortcut"> <div class="keys"> <a>?</a> </div> <h3>Open Shortcuts Page</h3> <p> Pressing \u201c?\u201d will open the shortcuts page. </p> </div> <div class="shortcut"> <div class="keys"> <a>@</a> </div> <h3>Autocomplete Members</h3> <p> When writing a comment, you can type \u201c@\u201d plus a member\u2019s name, username, or intials and get a list of matching members. You can navigate that list with the up and down arrows. Pressing enter or tab with a member selected will mention that user in the comment. The mentioned user will get a notification once submitted. </p> <p> When adding a new card, you can use the same method to assign members to cards before submitting them. </p> </div> <div class="shortcut"> <div class="keys"> <a>#</a> </div> <h3>Autocomplete Labels</h3> <p> When adding a new card, you can type \u201c#\u201d plus the label\u2019s color or title and get a list of matching labels. You can use the up and down arrows to navigate the resulting list. Pressing enter or tab will add the label to the composed card. The labels will be added to the card when you submit. </p> </div> <div class="shortcut"> <div class="keys"> <a>^</a> </div> <h3>Autocomplete Position</h3> <p> When adding a new card, you can type \u201c^\u201d plus a list name or position in a list. You can also type \u201ctop\u201d or \u201cbottom\u201d to add to the top or bottom of the current list. You can use the up and down arrows to navigate the resulting list. Pressing enter or tab will automatically change the position of the composed card. </p> </div> </div> ');
                return this.fl()
            },
